import { Fab, IconButton, Tooltip } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import { Box } from '@mui/system';
import React from 'react';

const Add = () => {
  return (
    <Box>
      <Tooltip title="Add">
        <IconButton>
          <Fab color="primary" aria-label="add">
            <AddIcon />
          </Fab>
        </IconButton>
      </Tooltip>
    </Box>
  );
};

export default Add;
